import axios from "axios";

export const ProductService = async (id, idCate) => {
  const API_URL = `http://localhost:3080/product/${idCate}/${idCate}`;
  try {
    const response = await axios.get(API_URL);
    return response.data.product[0];
  } catch (err) {
    console.error(err);
    throw err;
  }
};
